rule "GeoIP lookup: clientip"

when

  has_field("clientip")

then

let geo = lookup("geoip_city", to_string($message.clientip));

set_field("clientip_geo_location", geo["coordinates"]);

set_field("clientip_geo_country", geo["country"].iso_code);

set_field("clientip_geo_city", geo["city"].names.en);

end
